import React, { Component } from 'react';
import Main from './Components/Main'
import Heater from './Components/Heater'
import './App.css';
import Tabletest from './Components/Tabletest'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Heater/>
        <Main/>
        <Tabletest/>
      </div>
    );
  }
}

export default App;
